  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <>
     <Router>
     <Navbar></Navbar>
     <Compone></Compone>
     <Switch>
          <Route path="/Apron">
               <Apron />
          </Route>

      </Switch>
     </Router>
    </>
  );
}

export default App;
